function GetRequestDetails(n,t,i){var r=GetSearchParam(n,t,i);HttpPost(`/RequestForProceedingEviction/List`,"html",r,function(n){console.log(n);$("#divTable").html("");$("#divTable").html(n)})}function GetSearchParam(n,t,i){var r={letterReferenceNo:$("#txtFileNo").val(),AllotmentNo:$("#txtReferenceNo").val(),subject:$("#txtSubject").val(),FromDate:$("#txtFromDate").val(),ToDate:$("#txtToDate").val(),sortBy:$("#ddlSort").children("option:selected").val(),sortOrder:parseInt(i),pageSize:parseInt(t),pageNumber:parseInt(n)};return console.log(r),r}function onPaging(n){GetRequestDetails(parseInt(n),parseInt(currentPageSize),sortOrder);currentPageNumber=n}function onChangePageSize(n){GetRequestDetails(parseInt(currentPageNumber),parseInt(n),sortOrder);currentPageSize=n}var currentPageNumber=1,currentPageSize=5,sortOrder=1;$(document).ready(function(){GetRequestDetails(currentPageNumber,currentPageSize,sortOrder)});$("#btnSearch").click(function(){GetRequestDetails(currentPageNumber,currentPageSize,sortOrder)});$("#btnReset").click(function(){$("#txtReferenceNo").val("");$("#txtSubject").val("");$("#txtFileNo").val("");$("#txtFromDate").val("");$("#txtToDate").val("");GetRequestDetails(currentPageNumber,currentPageSize,sortOrder)});$("#btnAscending").click(function(){$("#btnDescending").removeClass("active");$("#btnAscending").addClass("active");sortOrder=1;GetRequestDetails(currentPageNumber,currentPageSize,sortOrder)});$("#btnDescending").click(function(){$("#btnAscending").removeClass("active");$("#btnDescending").addClass("active");sortOrder=2;GetRequestDetails(currentPageNumber,currentPageSize,sortOrder)});$(function(){$("#txtToDate").on("change",function(){var n=$("#txtFromDate").val(),t=$("#txtToDate").val();t<n?($("#txtToDate").val(" "),$(".msg").empty().html("To Date Must be Greater Than From Date ")):($(".msg").empty(),$("#txtToDate").val("#txtToDate".val()))})});